style.css:
:root {
    --primary-color: #3498db; /* Default primary color */
    --secondary-color: #2ecc71; /* Default secondary color */
}

body {
    font-family: 'Arial', sans-serif;
    background-color: #ecf0f1; /* Default background color */
    color: #333; /* Default text color */
}

header {
    background-color: var(--primary-color);
    color: #fff;
    padding: 10px;
    text-align: center;
}

main {
    padding: 20px;
}

footer {
    background-color: var(--primary-color);
    color: #fff;
    text-align: center;
    padding: 10px;
    position: fixed;
    bottom: 0;
    width: 100%;
}
